tldr; yoga is cray these days. How can we bring it back to the good 'ol days?

&amp;#x200B;

Sometimes when I look at the world of yoga in the present day, it seems we've blown everything out of proportion and turned yoga into this crazy gimmick: goat yoga, yoga + beer, yoga with glo sticks, halloween costume yoga, etc. I understand it can be fun and it invites in the mainstream folk who may be turned off by the traditional aspects of the practice or who may be intimidated to try, but it seems like the heart of the practice has gotten lost somewhere. Studios can only stay alive it seems by offering all these workout-focused classes that are hot and fast with loud music, and majority of people like that! How can we get back to the beautiful simplicity of the teachings, while still (as studios and teachers) stay alive? Thoughts on this?
